import React, { Component } from 'react'
import { storeProducts } from "./data"

export default class CustomObj extends Component {
    constructor(props) {
        super(props)
        this.state = {
            store: storeProducts.data,

        }
    }


    render() {
        let store = this.state.store;
        var tempObj = {};
        Object.keys(store).forEach(function (k) {
            var val = store[k];
            var key = val['customer_name'];
            var ele = val['month'];

            if (!tempObj[key])
                tempObj[key] = [];

            tempObj[key].push(ele);

        });
        console.log("result :", tempObj);

        var tempObj2 = {};
        Object.keys(store).forEach(function (k) {
            var val = store[k];
            var key = val['month'];
            var ele = val['item_name']

            if (!tempObj2[key])
                tempObj2[key] = [];

            tempObj2[key].push(ele);

        });
        console.log("result :", tempObj2);

        return (
            <>
                <h1>Hey</h1>
            </>
        )
    }
}
